  totalTime: Number,
  assignment: { type: Schema.Types.ObjectId, ref: 'Assignment' },

}
</code></pre>
<p>and I want to query all solutions, group them by assignment, but I only care for assignments that are public (isPublic === true).</p>
<p>But I have no idea where to make that query. Can you help me?</p>
<p>My aggregation so far looks like this:</p>
<pre><code>{
        $match: {
            assignment: {
                $exists: true,
                $ne: null,
