MongoDB: $match on a nested document after $lookup<p>I need to query a collection of timecards which are linked to jobs, while jobs are linked to facilities with a specific facility ID. I have the following aggregation query:</p>
<pre><code>Timecard.aggregate([
    { $match: query }, //some query parameters set before, doesn't matter here
    {
        $lookup: {
            from: 'jobs',
            as: 'job',
            localField: 'job',
            foreignField: '_id'
        }
    },
    { $unwind: '$job' },
    {
        $lookup: {
            from: 'facilities',
            localField: 'job.facilityId'
            foreignField: '_id',
            as: 'job.facilityId'
        }
    },
    { $unwind: '$job.facilityId' },
    { $match: {'job.facilityId._id':'5cad048d95d61a002f5a9edb'}}
];)
</code></pre>
<p>Everything before the last $match works just fine, jobs are populated into timecards, facilities are populated into jobs. But the match doesn't work for some reason. However, if I add facilityId field with</p>
<pre><code>{$addFields: {facilityId: '$job.facilityId._id'}}
</code></pre>
<p>and change the $match to</p>
<pre><code>{$match: 'facilityId':'5cad048d95d61a002f5a9edb'}
</code></pre>
<p>then it works.
The question is, is there a way to query a subdocument's field with dot notation this way?</p>

